import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom

const PastWinnerList = () => {
  const [winners, setWinners] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchHistoricalWinners = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:8000/api/restaurants/history/historical_winners/', {
          headers: { Authorization: `Bearer ${localStorage.getItem('access_token')}` }
        });

        console.log("Historical Winners Data:", response.data);

        setWinners(response.data || []);
      } catch (err) {
        console.error('Error fetching historical winners', err);
        setError('Error fetching historical winners');
        setWinners([]);
      } finally {
        setLoading(false);
      }
    };

    fetchHistoricalWinners();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div className="error">{error}</div>;
  }

  return (
    <div className="past-winner-list">
      <h1>Past Winners</h1>
      <Link to="/">
        <button>Back to Main Page</button>
      </Link>

      {winners.length > 0 ? (
        <ul>
          {winners.map((entry, index) => (
            <li key={index}>
              <strong>Date:</strong> {entry.date} <br />
              <strong>Winner:</strong> {entry.winner_name || 'No name available'} <br />
              <strong>Total Votes:</strong> {entry.total_votes || 'N/A'}
            </li>
          ))}
        </ul>
      ) : (
        <div>No historical winners yet</div>
      )}
    </div>
  );
};

export default PastWinnerList;
